// Extracting the properties object from the incoming telemetry data
var properties = msg.thing.properties;  // The 'properties' object contains all the fields you want

// Initialize an empty object to store the telemetry data
var telemetryData = {};

// Use a loop to iterate over all keys in the 'properties' object
for (var key in properties) {
    if (properties.hasOwnProperty(key)) {
        // Dynamically assign the value from 'properties' to 'telemetryData'
        telemetryData[key] = properties[key];
    }
}

// Return the telemetry data in the 'msg' field, along with metadata and msgType
return {
    msg: telemetryData,     // Send the extracted telemetry data as 'msg'
    metadata: metadata,     // Pass along the metadata as it is
    msgType: msgType        // Pass along the message type as it is
};
